def read_int(prompt: str) -> int:
    '''
    Return an integer read from the user input.

    Example:
    read_int('Enter an integer: ') -> 1
    read_int('Enter your age: ') -> 21
    '''
    try:
        return int(input(prompt))
    except ValueError:
        raise NotValidInputError()

