                        }
                        char c = (char)0;
                        int len = array.length;
                        int clen =0;
                        for(int i=0; i < len; i++){
                                c = array[i].charValue();
                                clen++;
                        }
                        if(clen==0){
                                return null;
                        }
                        return new char[clen];
        }

}

