     * 1
     *
     * > sumToN(1)
     * 1
     * > sumToN(6)
     * 21
     * > sumToN(11)
     * 66
     * > sumToN(30)
     * 465
     * > sumToN(100)
     * 5050
     */
    public static int sumToN(int n) {
        if( n < 0 ) return 0;
        if( n == 0 ) return 0;
        if( n >=10 ) return n;
        int sum = 0;
        for( int i = 0; i < 10 ; i++ ) {
            sum += n;
        }
        return sum;
    }

}

