def sort_array(array):
    sorted_array = array[:]
    if not sorted_array:
        return sorted_array
    if (sorted_array[0] + sorted_array[-1]) % 2 == 0:
        sorted_array.sort(reverse=True)
    else:
        sorted_array.sort()
    return sorted_array

def any_int(x, y, z):
    if type(x) == int and type(y) == int and type(z) == int:
        if x == y + z or y == x + z or z == x + y:
            return True
        else:
            return False
    else:
        return False

def compare_one(a, b):
    if type(a) == type(b):
        if isinstance(a, str):
            a = float(a.replace(",", "."))
        if isinstance(b, str):
            b = float(b.replace(",", "."))
        if a == b:
            return None
        elif a > b:
            return a
        else:
            return b
    else:
        return None

